func main() {
	// 解析命令行参数
	var concurrency int
	var rounds int
	var url string
	var file string
	flag.IntVar(&concurrency, "c", 1, "concurrency level")
	flag.IntVar(&rounds, "r", 1, "number of rounds")
	flag.StringVar(&url, "u", "http://172.20.40.21:9001/transmission-detection", "url")
	flag.StringVar(&file, "f", "", "url")
	flag.Parse()

	if len(file) == 0 {
		fmt.Println("file must need")
		return
	}

	fileStr, err := ioutil.ReadFile(file)
	if err != nil {
		fmt.Println("file read error", err)
		return
	}

	// 执行测试
	var wg sync.WaitGroup
	for i := 0; i < rounds; i++ {
		fmt.Printf("Round %d\n", i+1)
		start := time.Now()
		ch := make(chan string, concurrency)
		for j := 0; j < concurrency; j++ {
			wg.Add(1)
			go fetch(url, ch, &wg, string(fileStr))
		}
		go func() {
			wg.Wait()
			close(ch)
		}()
		count := 0
		totalTime := 0.0
		for result := range ch {
			count++
			elapsed, _ := strconv.ParseInt(strings.Split(strings.Split(result, ",")[0], " ")[2], 10, 0)
			totalTime += float64(elapsed)
			fmt.Println(result)
			if count == concurrency {
				break
			}
		}
		elapsed := time.Since(start)
		fmt.Printf("Total time: %.2f seconds, average time: %.2f milli seconds\n", elapsed.Seconds(), totalTime/float64(count))
	}
}

var client *resty.Client

func init() {
	client = resty.New()
	client.SetTimeout(5 * time.Minute)
}

func fetch(url string, ch chan<- string, wg *sync.WaitGroup, fileStr string) {
	defer wg.Done()
	start := time.Now()

	resp, err := client.R().SetHeader("Content-Type", "application/json").SetBody(fileStr).Post(url)
	if err != nil {
		ch <- fmt.Sprintf("%s error: %v", url, err)
		return
	}
	elapsed := time.Since(start).Milliseconds()
	ch <- fmt.Sprintf("%s cost %d ms, httpcode %d", url, elapsed, resp.StatusCode())
}

